import {useEffect, useState} from "react";
import axios from "axios";

const Weather = ({latlng}) => {
    const [weather, setWeather] = useState({})

    console.log('lat', latlng[0])
    console.log('lng', latlng[1])
    const api_key = process.env.REACT_APP_API_KEY
    const hook = (latlng, api_key) => {
        const lat = latlng[0]
        const lng = latlng[1]
        axios.get(`https://api.openweathermap.org/data/2.5/weather?lat=${lat}&lon=${lng}&appid=${api_key}`)
            .then(response => { setWeather(response.data) })
    }
    useEffect(hook(latlng, api_key), [])

    console.log(weather);
    return (
        <div>
            <p>test</p>
        </div>
    )
}

const Country = ({country, back}) => {
    return (
        <div>
            <h1>{country.name}</h1>
            <p>capital {country.capital}</p>
            <p>area {country.area}</p>
            <h2>languages:</h2>
            <ul>
                {country.languages.map(language =>
                    <p key={language.name}>{language.name}</p>
                )}
            </ul>
            <img src={country.flags.png} alt={"flag"}/>
            <div>
                <button onClick={back}>back</button>
            </div>
            <Weather latlng={country.latlng} />
        </div>
    )
}

export default Country;
